class TopPanel extends Component {

    render() {

        return (
            <div id="top-panel" className="SidePanel-container" style={{backgroundColor: '#333d6a', width: '100%', height: '5em', textAlign: 'center'}}>
               <p style={{color: "white", fontSize: '1.5em'}}>
                   TOP PANEL
               </p>
            </div>
        );
    }
}

export default TopPanel;
